import React, { useEffect, useState } from 'react';
import './Home.css';

function Home() {
  const [slideIn, setSlideIn] = useState(true);

  useEffect(() => {
    setSlideIn(true);
  }, []);

  return (
    <div className={`image-slider ${slideIn ? 'slide-in' : ''}`}>
      <img src="./sample.JPG" alt="Sliding Image" />
    </div>
  );
}

export default Home;
